How its Made Season 22

This documentary shows how common, everyday items are manufactured.
An off-screen narrator explains each process, often with excessive puns. Each half hour show usually has three or four main segments, with each product getting a demonstration of about five minutes, with exceptions for more complex products.

The show was origionally aired in Canada. When the show was aired in the US it followed a different Season formatte.


